import React, { useState, useEffect } from 'react'
import "./serviceList.css"
import Service from '../../components/service/Service'

function ServiceList({services, alert, setAlert}) {
    // const [services, setServices]= useState([]);
    // const [alert, setAlert] = useState("");

    // const fetchServices= async()=>{
    //     try {
    //       const data=await fetch("/services");
    //       const response= await data.json();
    //       setServices(response)
    //     } catch (error) {
    //       console.log(error.message)
    //     }
    //   }
    //   useEffect(()=>{
    //     fetchServices()
    //   },[alert])


    return (
        <div className="service-list">
              {services.length != 0 ? services.map((element)=>(
                  <Service element={element} alert={alert} key={element.id} setAlert={setAlert} />
              )): <span id="error">No match found</span>}
        </div>
    )
}

export default ServiceList
